package org.vaadin.mvp.uibinder;

public class UiConstraintException extends UiBinderException {

  public UiConstraintException() {
  }

  public UiConstraintException(String message, Throwable cause) {
    super(message, cause);
  }

  public UiConstraintException(String message) {
    super(message);
  }

  public UiConstraintException(Throwable cause) {
    super(cause);
  }

}
